INSERT INTO `portalapp_experience_internship` VALUES (2,'6+ CGPA',1,15000,7.59,2,'  Do not panic, the interviewers also are under stress.\r\nAnswer precisely, do not beat around the bush (if you know what i mean)\r\nAsk questions, they do like it.','2017-02-28 12:09:03',1,2,1,6,7,NULL,NULL,NULL,NULL,15588,1),(3,'7+ CGPA',1,20000,7.62,2,'* Knowledge of databases and cloud will give you benefit\r\n* Interviewer can ask tricky questions based on projects/Internships (listed in resume)\r\n\r\n','2017-02-28 18:16:43',1,3,1,8,9,NULL,NULL,NULL,NULL,15862,1),(4,'Company had a pointer criteria',1,40000,8.54,2,' Always have a hurray moment either you are selected or rejected.','2017-03-01 18:04:24',1,4,7,10,11,NULL,NULL,NULL,NULL,15786,1),(5,'No criteria',1,25000,8.54,2,'Geeksforgeek provides all these kind of questions with solution. A good platform for preparation.','2017-03-01 18:04:24',1,5,7,12,13,NULL,NULL,NULL,NULL,15786,0),(6,'CGPA 7.0 and above; No Backlogs; CSE, ECE, EEE',1,30000,7.62,4,'Stay calm, and don\'t make silly mistakes. Keep your basics crystal clear. Enjoy giving the interview. All the best :)\r\nSelected 5 students for the internship(I was one of them :)!)\r\nOverall, it was a good experience, and a memorable one too!','2017-03-01 19:14:19',1,6,1,14,15,16,17,NULL,NULL,15630,1),(7,'Initial pointer cutoff to be eligible for the test was 8 which was then increased.',1,40000,9.1,3,' For Citi, just be thorough with the basic data structures and sorting algorithms. The most difficult coding questions will probably be in the online round itself. In the interviews, it gets easier. Good communication skills can be your X-factor. And reiterating one of my aforesaid points, be honest in the HR interview and you\'ll nail it. All the best! :)','2017-03-02 08:04:37',1,4,1,34,35,36,NULL,NULL,NULL,15615,1),(8,'CGPA 7.0 and above; No Backlogs; CSE, ECE, EEE',1,30000,9.23,4,' It is an easy interview overall to clear, provided that you are really aiming for this company with a proper preparation beforehand.\r\nIts a great company to work in. ALL the BEST !','2017-03-02 08:04:37',1,6,1,37,38,39,40,NULL,NULL,15613,1),(9,'Pointer criteria: 6.5 with no current backlogs ',1,71000,8.43,2,' 1. Never lie and bluff in interview about projects you have not actually done.\r\n 2. Think aloud and be precise in your answers.','2017-03-04 08:43:02',1,12,1,53,54,NULL,NULL,NULL,NULL,15866,1),(10,'8+ but was raised later',1,40000,8.67,3,' Just be yourself. Be very confident about the concepts you know. Never double guess, but be open to code review suggestions. ','2017-03-05 11:03:31',1,4,1,59,60,61,NULL,NULL,NULL,15577,1),(11,'6.0',1,60000,8.1,3,' Interview was good, What is important is to be sure before answering, it\'s ok if you are not able to answer all questions. All the best :)','2017-03-06 09:04:43',1,5,1,65,66,67,NULL,NULL,NULL,15859,1),(12,'B.Tech - pre-final CSE, No current Backlog, No CGPA cut-off',1,30000,9.62,3,' ','2017-03-06 09:04:43',1,8,1,68,69,70,NULL,NULL,NULL,17351,1),(25,'',1,0,0,1,'','2017-07-07 10:58:12',3,NULL,1,111,NULL,NULL,NULL,NULL,NULL,15616,1),(26,'',1,0,0,1,'','2017-07-07 10:58:12',3,NULL,1,112,NULL,NULL,NULL,NULL,NULL,18475,1);
