INSERT INTO `portalapp_experience_placement` VALUES (5,'Summer Intern at Morgan Stanley',0,1600000,7.62,3,'Unlike other companies, who give PPO to interns solely based on their performance, here at Morgan Stanley, your performance doesn\'t matter. What matters is how well you perform at the interviews. So the future interns, prepare for the interviews thoroughly.\r\nFinally, they gave Pre-Placement Offers to 10 out of 28 interns(I was not selected :(!)','2017-03-01 19:14:19',1,6,1,18,19,20,NULL,NULL,NULL,15630,0),(6,'CGPA 6.0 and above; No backlogs; CSE, ECE, EEE',1,1200000,7.62,3,'Don\'t be surprised if you fare well at the interviews and didn\'t get selected. The company randomly selects students.\r\nSelected 9 students (I was not selected :(!)','2017-03-01 19:14:19',1,7,1,21,22,23,NULL,NULL,NULL,15630,0),(7,'The company had a pointer criteria of 6.0 and no current backlogs.',1,1200000,8.81,5,' ','2017-03-01 19:14:19',1,8,7,24,25,26,27,28,NULL,16014,1),(8,'CGPA 7.0 and above; No backlogs; CSE, ECE, EEE',1,750000,7.62,5,'The interview questions are easy, just hold your nerve and stick to the basics. Be EXTREMELY STRONG in concepts, and don\'t commit \'unforced errors\'. Moreover, unlike other services-based companies or investment banks, Oracle is a product-based company, and you have a FAST CAREER GROWTH here, and you would be usually be having an upper hand over the ones working at service-based companies or at investment banks.\r\nSelected 7 students (I was selected :)!)','2017-03-01 19:14:19',1,9,7,29,30,31,32,33,NULL,15630,1),(9,'6.0',1,2700000,7.6,5,' If you want a placement/internship at amazon start doing competitive coding or be ready to mug up entire geeksforgeeks.org.\r\nAnd don\'t panic during the interview the panelists are very friendly. If you are struck at a point or did not understand the question properly ask them multiple times. Also dont hesitate to discuss even the most lames\'t solution and don\'t be mum keep on speaking to the panelist what are you currently thinking this shows that you are making some progress and sometims the panelist me give some hints without even you asking for it. Of course you can always ask for some hints here and there.\r\nAfter each round the panelist asks you whether you have any questions make sure you utilise this opportunity and ask some relevent questions this will help you learn more about the firm and the working conditions there.\r\nPrepare atleast one of these subjects really well operating systems, computer networkng and DBMS. ','2017-03-02 08:04:37',1,8,1,41,42,43,44,45,NULL,15858,1),(10,'CGPA 6.0 and above;NO backlogs ; CSE,ECE ,EEE',1,885000000,7.2,4,'Going through DSPD-1 and DSPD-2 would be most helpful','2017-03-02 08:04:37',1,10,1,46,47,48,49,NULL,NULL,15774,1),(11,'CGPA - 7.0',1,800000,7.86,3,'1. Keep your basics clear.\r\n2. Stay Calm.\r\n3. Go with the flow. No need to panic. Interviewer is just another human being like yourself :P Its just a normal conversation about things you have already done and studied.\r\nFeel Free to contact anytime. Good Luck! :)\r\n','2017-03-02 08:04:37',1,11,7,50,51,52,NULL,NULL,NULL,15649,1),(12,'CGPA-6.0 and no current backlogs.',1,885000,8.92,4,' Just be cool. It is always ok not to know everything they ask. Just tell them that you are not much familiar with the topic but would be zealous to learn it. At such times, they look for an eagerness to learn and try to drift the interview in the area of your expertise, if given a chance.','2017-03-04 08:43:02',1,13,1,55,56,57,58,NULL,NULL,15575,1),(13,'Above 7 cgpa',1,600000,8.85,3,' The first two rounds were crictical so those who are aspiring to work in Siemens will have to start practising aptitude questions atleast 2 months prior to the test.I would recommend you to prepare for this in summer vacations.For the interview you just need to maintain composure and if you are lucky enough then the interviewer will himself make you feel relaxed.Always ask 2 -3 questions at the end of the interview .It would show your eagerness to join the company.','2017-03-06 09:04:43',1,14,6,62,63,64,NULL,NULL,NULL,15598,1);
