INSERT INTO `portalapp_interviewround_details` VALUES (6,17,'*Briefed about the on-going internet connection problem, and told that call can get disconnected abruptly*\r\n*Skype call starts*\r\n*Initial greetings and pleasantries*\r\nI-Interviewer; M-Me\r\n\r\nI-Languages you are comfortable with ?\r\nM-*told him*\r\nI-Implement calculator functions using derived class functions\r\nM-*done*\r\nI-Some basic questions about OOPs\r\n*call got disconnected*(VERY BAD CONNECTION)\r\nI- WAP to convert hex to binary\r\nI-debug by inserting print statements\r\n*call got disconnected*\r\nI-that\'ll be all\r\n*call got disconnected abruptly*',1,10),(7,11,'Interviewer was feeling under the weather, so he asked me questions that i would like to answer\r\n*gave him a plethora of options of generic HR questions*\r\nSome general talks about his health.\r\nHe offered me some hot beverages.*declined*\r\nAsked him about the work culture there and his experience working with wipro.\r\nHe asked me my preference of location for the internship.*Bluntly replied Bangalore, regretted it later*\r\nexchanged pleasantries and bade farewell.',1,11),(8,0,'Shortlisting based on :\r\n* CGPA\r\n* Projects / Internships\r\n\r\n* Total 10 students were shortlisted',1,13),(9,30,'*** SKYPE INTERVIEW ***\r\n\r\n*  Tell me about yourself\r\n*  Basic questions on BST, AVL-trees\r\n*  WAP to rotate array around pivot (Gave his own coding pad)\r\n*  WAP to generate prime numbers\r\n*  What are the types of link list? How to detect and remove a loop in link list?\r\n*  Basic concepts of OOPs like inheritance, polymorphism\r\n*  2-3 easy puzzles\r\n*  Lot of questions were asked based on projects/Internships ( Android development , AWS, web development) \r\n*  Total 5 students were selected from campus\r\n*  Basic HR questions ',3,15),(10,30,'\r\na)How to solve Sudoku as given in any news paper with the help of c program.\r\nI explained him the solution(related to backtracking) then further Interviewer discussed on complexity(9^n) and methods so that i can improve the complexity of my solution(hash tables)\r\n\r\nb)Asked about competitive coding ,i.e which online platform you use more for practice?,rank on that platform?(benefit of competitive coders)\r\n\r\nc)Next Question Given a array of +ve numbers,find the nearest greater for each number in array on its right side.Give a sol in o(n) complexity.\r\nSolved it based on concept of stacks(learned from code chef).I explained him first then interviewer ask me to the code and i successfully completed that.Very important to cover all edge cases for written code\r\n\r\nd)Next Question Insert the node in link-list before the nth last node.\r\nA little bit hint given by Interviewer ,I got the solution Then again interviewer told me to write code.Interviewer was again checking that am i covering all the test cases or not\r\n\r\nnext and last.\r\ne)Robot puzzle \r\nI  solved that good puzzle\r\n',3,10),(11,30,'HR round- all general Questions\r\na)Introduction\r\nb)Family Background\r\nc)About Hobbies\r\nd)Situational Questions\r\ne)Surprisingly Difference between malloc and calloc\r\n\r\nAt last I was selected for intern at CITI (Hurray Moment).\r\nAnd after internship I was not selected for the full time job(Hurray Moment again) but i really enjoy 2 month stay at CITI',1,11),(12,45,'Online coding and apptitude test \r\n18 MCQs and 2 Coding Questions\r\n',3,16),(13,45,'a) Given two positive number,using both find out the nth bit (binary) of the sum of given two number?\r\n\r\nI told Interviewer the simplest solution but he was not satisfied, Interviewer want the better complexity. I can\'t completely solved the question but I solved it partially  according to interviewer (Even i don\'t know how). Solution lies in moving back from nth bit to rhs part of binary numbers.\r\n\r\n\r\nb)Given a large string,find out the length of longest palindrome in the string\r\n\r\nAgain I started with simplest solution , then for better complexity Interviewer gave me hints . I framed new solution and I was told to write a code ,I wrote the code completely  but i forgot to handle the odd length.I missed just an IF block.They look for 100% accuracy.So always cover all test cases while writing code\r\n\r\nI was not selected for the further round but a damn good interview for me without any preparation.I enjoyed it fully.\r\n\r\n',2,10),(14,90,'Firstly, an online test was conducted(90 minutes duration) on HackerRank, consisting of 19 MCQs(Data Structures, C concepts, programming concepts, data interpretation, verbal skills) and 2 coding questions(One based on string manipulation and other based on All-Pair Shortest Path Graph).\r\n12 out of around 100 students were shortlisted for the interviews.',3,16),(15,20,'This was my first interview ever(I had given many vivas during my school years, but never gave an interview before), so was feeling pretty nervous.\r\nThe interviewer asked if I was feeling nervous, to which, I replied \"Yeah, somewhat nervous!\". The questions that followed were:\r\n*Tell me about yourself.\r\n*What do you know about Morgan Stanley?\r\n*What did you do in your summers, at the end of 2nd year?\r\n*Your CodeChef and HackerRank rank.\r\n*Tell me any one incident of your life that you feel is regretful?\r\n*Apart from Morgan Stanley, were you interested in any other companies?\r\n*Why Morgan Stanley?\r\n*Your strengths.\r\n*How do you see yourself 5 years from now?\r\nand many more such kind of questions.\r\nThen I asked him whether we\'d choose our preferred location(Mumbai or Bengaluru) or would they allot us randomly, and on the life at Morgan Stanley.',2,11),(16,30,'*Explain Call by Value and Call by Reference, using call stack, giving suitable examples. (Written Code)\r\n*Is it possible to find the factorial of a given number without using any loop or recursion?(Written Code)\r\n*Given a binary tree, print all the boundary nodes, i.e., all the leftmost, rightmost, and leaf nodes.(Written Code)\r\n*What do you know about Operating Systems?\r\n*Differences between Windows and Linux, advantages of Linux over Windows.\r\n*Explain about the Task Manager and its various processes.\r\n*Threads and processes.\r\n*Difference between the operation of Chrome and Firefox.\r\n*Differences between C and C#.\r\n*Explain Linked Lists in detail.\r\n*What will you prefer for Stack implementation- Arrays or Linked Lists?\r\n*Given a processor, which is running various processes simultaneously, of different time duration. These processes are stored in a circular linked list of fixed size. There are processes in waiting as well, which are stored in a queue. We have to print the id number of processes that have just finished, and add the waiting process from the queue to this circular linked list. At the same time, the time duration of other processes get reduced by some fixed amount. Repeat this till the queue as well as circular linked list gets exhausted(out of elements). (Written Code)\r\nThen I asked him about the projects that we\'ll be working on. He was a friendly person and told me about many live projects that they generally give to interns at Morgan Stanley. He also explained in detail about the project he is currently working on.',1,10),(17,20,'Firstly, the interviewer asked me what do I know about Morgan Stanley and its functioning and provided services in brief.\r\nThen he asked me about my favourite topic, to which I replied Data Structures.\r\nWhat are stacks and queues?\r\nWhat is OOP?\r\nThen he gave me a real-life scenario of managing a lift/elevator system. You have 3 lifts, and one control on each floor, i.e., the same up-down button can call any of the 3 lifts. Design the system, considering various factors in mind, like how to prioritize the selection of lifts, on the basis of the floor difference or on the basis of time, or on some other basis. Then he gave me some examples of floor numbers where the lift gets called, and the initial position of the lift, and asked me how I would handle these scenarios. It was a long discussion, lasting for about 15-20 minutes, where he gave me various situations and asked my approach. Basically, he just wanted to know my thought process, and my approach and logic towards solving such real-life scenarios. Then at last, he asked me the data structure I would be using for this implementation, to which I replied \'Doubly Linked List\'.\r\nHe then asked some HR questions:\r\n*What are your strengths?\r\n*What are your weaknesses?\r\n*Why Morgan Stanley?\r\nand many more.',1,10),(18,50,'There were 2 interviewers. The questions asked were:\r\n*Explain in brief about your intern project.\r\n*Implement any SQL query in any suitable language(preferably C/C++/Java), using suitable data structures for implementation as well as storing the result. The SQL query may contain joins of various tables. (Written Code)\r\n*What is malloc?\r\n*Static and dynamic memory allocation in C.\r\n*Some questions based on pointers in C.\r\n*A code was given, based on pointers in C, tell whether the code will run perfectly or generate some compilation/runtime error.\r\n*Stack and heap memory in C.\r\n*Find factorial of a number, considering all the base cases as well as big input. (Written Code)\r\n*What is normalization in databases? Why is it helpful?\r\n*What are Collections in Java?\r\n*Which data structure in Java would be used, such that infinitely many elements could be added, depending on the choice of the user, and the elements should be accessed directly, in O(1) time(Indirectly, a hybrid of Array and LinkedList). Implement the same data structure in C.\r\n*You are given a 4 GB RAM. How would you run 20 GB processes using this 4 GB RAM? (OS - Virtual Memory concept)\r\n*What are threads and processes?\r\n*How different is C# from other languages?\r\n*How a program gets compiled and run?\r\n*Explain the various stages that happen during the compilation of a program.\r\n*How a program gets compiled and run in C?\r\n*How a program gets compiled and run in Java?\r\n*What is JVM? Explain in detail.\r\n*What are JRE and JDK?',2,10),(19,30,'There were 2 interviewers. The questions asked were:\r\n*Explain in detail about your intern project.\r\n*Using Object-Oriented concepts, design a college academic system, containing students, details of every student, departments, details of every departments, courses available, and much more. After creating the necessary classes, methods and variables for this system, create appropriate methods to find the topper of a particular department, rank of a particular student, topper of a subject etc. An ideal object-oriented code in Java was expected. (Written Code)\r\n*How was your experience at Morgan Stanley?\r\n*Your feedback of your team members?\r\n*Your favorite subject\r\nand many more.\r\n',3,10),(20,20,'*Tell me about yourself.\r\n*How was your experience at Morgan Stanley?\r\n*Explain in brief about your intern project.\r\n*Did your team members help you?\r\n*Any qualities that your team members need to improve upon.\r\n*What are your strengths and weaknesses?\r\n*Have you ever lead a team? Your leadership experience.\r\n*Have you ever had any conflict in opinions? With juniors? With seniors?\r\n*Why should we hire you?\r\nand many more typical HR questions.',1,11),(21,30,'Firstly, an online round was conducted. It consisted of verbal and aptitude questions only. No technical or coding questions. The questions were extremely easy.\r\nShortlisted 48 out of around 100 students for the interviews.',1,16),(22,30,'The interviewer covered almost all the topics that are generally asked in the technical interviews. The asked questions were:\r\n*Explain in brief about your summer internship project.\r\n*Differences between SOAP and REST.\r\n*Do you know any scripting languages?\r\n*What do you mean by time complexity? What is big O notation?\r\n*What is the time complexity of the famous sorting algorithms?\r\n*How would you find the second largest element in an unsorted array? n\'th largest element? Time complexity in both the cases.\r\n*A recursive code was given. Give the output or tell whether the code would generate any compilation/runtime error.\r\n*Find whether 2 given strings are anagrams. (Written Code)\r\n*Given a dictionary, containing valid English words, find the minimum number of swaps required to convert one string to another. In one swap, you can only change one letter of the string, such that the new string formed is a valid English word. Hint:- Use graph, where every node is the valid English word, and 2 nodes are connected, if only 1 swap is required to convert one word to another. (Written Code)\r\n*What is multithreading? How is it efficient?\r\n*What is OS?\r\n*What are threads and processes?\r\n*What are collections in Java?\r\n*Common questions on OOPS, like what is inheritance, polymorphism, operator overloading, abstract functions, abstraction etc.\r\n*Puzzle: There are different number of pairs of socks of different colors, c1, c2, c3, ...., c20, such that there is 1 pair of c1, 2 pairs of c2, 3 pairs of c3, ...., 20 pairs of c20. What is the maximum number of socks you need to take out such that a pair is made, containing both the pieces of same color.\r\nand many more technical questions.',1,10),(23,20,'*Tell me about yourself.\r\n*Tell me one point you liked about Fidelity, in the presentation.\r\n*Why Fidelity?\r\n*What other companies\' interviews have you given?\r\n*Why should we hire you?\r\n*Do you have any post-graduation plans?\r\n*Would you like to work on new, modern technologies, or the conventional technologies, which have been used for years? Why?\r\n*Have you ever lied?\r\n*What are your strengths and weaknesses?\r\n*Your preferred joining location. Why?\r\nand many more HR related questions.',1,11),(24,60,'20 MCQs + 2 Coding Questions:\r\n\r\nMCQs – Topics: OS – Page fault, Waiting time (RR Scheduling), Paging, Semaphores, etc.\r\n	DS – Hashing (simple chaining based numerical)\r\n	Aptitude – 1 Probability question, Puzzle – 1 question, C– 2 questions, etc.\r\n',1,16),(25,45,'In this round the interviewer asked me the below two questions.\r\n1.a) Given a number find the next greater number with the same set of digits.(http://www.geeksforgeeks.org/find-next-greater-number-set-digits/)\r\n	I had to write the complete code covering all the edge cases.\r\n	Since I had practiced this question, it didn\'t take much time to code for it.\r\n1.b) Given a Binary Tree, convert this to a tree where each node contains the sum of the left and right sub trees in the original tree.(http://www.geeksforgeeks.org/convert-a-given-tree-to-sum-tree/)\r\n	For this question, first I discussed the approach, confirmed the edge cases and then wrote the code using recursion.\r\n',1,10),(26,45,'This round started with questions from Operating Systems.\r\n	The interviewer asked me questions on Process and Threads, Process Scheduling, Mutex and Semaphores and Memory Management.\r\n	Some of the questions that were asked:\r\n	a) Difference between process and thread.\r\n	b) Advantages and disadvantages of using threads.\r\n	c) Difference b/w Scheduler and Dispatcher.\r\n	d) Name all the process scheduling algos and explain the Round Robin Process Scheduling.\r\n	e) At max how many threads can be active at a time in a machine?\r\n	f) What is race condition and how do we avoid it?\r\n	g) Difference between Semaphores and Mutex?\r\n	h) What is secondary memory and why do we use it?\r\n	i) What is thrashing?\r\n	\r\n	Then he asked me questions on Computer Networks.\r\n	a) Explain OSI reference model and write all the layers present in this model along with the protocols used at each layer.\r\n	b) Difference between TCP and UDP.\r\n\r\n	Finally he gave me a problem and told me to first discuss the approach with him and then code the same covering all the edge cases.\r\n	The problem was as follows:\r\n	You are given an infinite stream of numbers, at any instant of time you have to print the earliest non-repeating number.\r\n	eg: 2 3 4 2 5 6  output 3\r\n	    2 3 4 2 3 7 8 output 4\r\n	I discussed my approach with him, he told me to further increase the efficiency and gave me hints.\r\n	With his hints, I came up with the final solution (using Doubly Linked List and HashMap) and wrote the code.\r\n	He evaluated it and spotted 3 errors.',3,10),(27,45,'In this round the interviewer asked me questions on the Internship project.\r\n	He told me to briefly explain the complete project and asked various questions on the same.\r\n	\r\n	Then he gave me a coding question and asked me to first explain the approach and then code.\r\n	The question was,\r\n	You ar given an infinite stream of numbers and an integer k, at any instant of time you have to print the top k elements scanned till that point.\r\n	I explained the naive approach of using an array of size k and then inserting the elements at proper position thus making sure\r\n	that the array always remained sorted. Complexity O(k)\r\n	He was not satisfied with this solution and told me to further improve it ie aim for O(log(k)).\r\n	I did some brainstorm for a while and then gave the final solution to him using a min heap of size k.\r\n	He also asked me to write down complete code for min heap.\r\n	\r\n	The next question was on Caches.\r\n	He asked me to tell different page replacement policies.\r\n	Then he asked me, \"How would you implement LRU Cache\"?\r\n	I told him that it can be implemented using Priority Queue.\r\n	Then he cross-questioned me on Priority Queues, its internal implementation and complexities.\r\n	He didn\'t ask to code for it.',3,10),(28,45,'You are given an infinite stream of numbers, at any instant of time you have to print the median of the elements scanned till that time.\r\n	Median of an array here refers to the middle element of the array after sorting.\r\n	First I told him that I would maintain a sorted array, thus order of insertion would be O(N) and order of query would be O(1).\r\n	He told me to further optimize it.\r\n	I thought of using heaps and somehow try to achieve O(log(N)) for both insertion and query, but then he told me that it can be further optimized.\r\n	He told me to aim for O(log(N)) and O(1) for insertion and query respectively.\r\n	Suddenly I got the idea that I could make use of a minheap and a maxheap to solve the problem.\r\n	I discussed my approach with him. He was impressed.\r\n	Finally I coded the problem.\r\n	At last he asked me, \"Given an inorder traversal of a BST, can u build the tree\"?\r\n	I told him yes. Then he asked me, \"How many such trees are possible\"?\r\n	I knew answer to this question, as it was taught in the class.\r\n	I told him about Catalan Number.',2,10),(29,120,'Firstly, an online test was conducted on Oracle platform, consisting of 4 sections - Verbal, Aptitude, Programming Skills, Computer Science Concepts. There was separate time for each section, and each section contained subsections as well. The questions were easy.\r\nShortlisted 40 out of 65 students for the interviews.',1,16),(30,60,'*Check whether a tree is balanced or not / Check for AVL tree. (Written Code)\r\n*What are collections in Java?\r\n*Implement a HashMap collection in Java.\r\n*Find the maximum continuous subarray sum of an unsorted array, consisting both positive and negative elements / Kadane\'s algorithm. (Written Code)\r\n*Puzzle: There is a worker, working for 7 days. You have a long piece of gold, of which you give 1/7th of the piece to the worker daily. Find the minimum number of cuts required to make in the gold piece, such that the worker gets his fair share each day.',3,10),(31,30,'*There is a bank, containing \'c\' counters. There are \'n\' people standing in a queue. The counters open at 9:00 A.M. There is also an array a[n] given, containing the time taken by every person to complete his/her query at the counter. Whenever one counter gets empty, the very next person in the queue goes to that particular empty counter. Find at what time the x\'th person (x <= n) will have his/her turn and at which counter. A fully working code was expected, considering all the base cases and exceptions, with proper syntax. (Written Code)',1,10),(32,30,'*Do you have any questions?\r\n*Why did your CGPA fall so drastically in the sixth semester?\r\n*What is your favorite subject from CSE point-of-view and from non-CSE point-of-view?\r\n*Some questions on my favorite subject from non-CSE point-of-view. (Geography :p)\r\n*Given a linked list, check whether the linked list contains a loop. (Written Code)',1,10),(33,20,'*Tell me about yourself.\r\n*What did you like in the presentation about Oracle?\r\n*Given a location preference, which location would you choose, why?\r\n*Your one quality, that makes you stand apart from others.\r\n*Your one weakness, that would affect others working in the firm.\r\n*Any future post-graduation plans.\r\n*What other companies have you applied for?\r\nand many more typical HR questions.',1,11),(34,20,'1. General questions on data structures - deletion of nodes from B Trees, mirror image of B Tree.\r\n2. Questions on complexity.\r\n3. Standard puzzles.\r\n4. Object Oriented Programming concepts.\r\n\r\nAdvice to non-CS people : Try to solve a few puzzles in your preparation, at least the standard ones like the egg drop puzzle. Because non-CS people are not expected to be well-versed with the syntax of programming languages, ability to solve puzzles will justify your grasp on the logic of a problem\'s solution.\r\nAlso, try to think loud while solving a question in front of the interviewer, don\'t write your solutions as if you\'re writing your exams. Written and working code is expected, so practice writing code on paper rather than on your machine.',1,10),(35,30,'This is generally the make-or-break round as far as Citi goes. Not that the technical round matters any less, but this is the round where you\'ll be grilled absolutely. Questions in the HR round are generally developed from the answers you give. There will be standard HR questions like \"Why Citi?\" and the likes, but you have to give well reasoned and honest answers. Because they\'re going to get to the depth of your answers in the subsequent counter questions. One question I remember being asked was \"Why should we not hire you?\". There\'ll be a couple of panelists for this round. They will try to assess whether you have the knack for understanding the business perspective behind the technology, because at the end of the day, technology is just an enabler for them.  ',1,11),(36,10,'This is typically the elimination round, if you have made till here. The panelist is usually a Senior Vice President or a Director who\'ll probably be heading your department at Citi. In my case, he turned out to be so. During the time we had our interview, ie, in 2015, there was a project at Citi on memory allocators (which I later realised). The interviewer asked a few common questions based on dynamic memory allocators to many of those who had made it till the third round, among other questions which were a mix of both technical and HR. The interviewer was a no-nonsense guy and expected brief and to the point answers.',3,10),(37,90,'Firstly, an online test was conducted(90 minutes duration) on HackerRank, consisting of 19 MCQs(Data Structures, C concepts, programming concepts, data interpretation, verbal skills) and 2 coding questions(One based on string manipulation and other based on All-Pair Shortest Path Graph).\r\n12 out of around 100 students were shortlisted for the interviews.',3,16),(38,45,'1. Memory management questions related to computer architecture\r\n2.Mirror Image of a tree.(code)\r\n3.Number of rectangles of specific dimensions in an isoceles triangle of specific dimensions.(code)\r\n4.Find the largest possible sum of five numbers in an array of n numbers.(code). Best possible solution with system constraints provided.\r\n5.Where is memory allocated for different types of variables in memory -heap or stack?\r\n6.Simple questions related to trees and efficiency.\r\n\r\nWhat do they expect :\r\n- Well indented code.\r\n- function beak down\r\n- proper parameters of functions.\r\n- Don\'t even CUT your code once written, meaning that think properly and then write. Show them that you are a true CODER.',1,10),(39,30,'Don\'t remember the exact questions. Some of the above mentioned questions were asked here. \r\n* It was en easy round.\r\n',1,10),(40,60,'1. Why should i believe that u like coding?\r\n-> Gave them a staright forward answer that my resume well gives you the answer to this.\r\nMy resume had good projects and some courses which i had done from \'Coursera\' during my engineering.\r\nThey expect you to have a true love for Coding or say for Computer Science and you are here with some moto.\r\n\r\n2. Why Morgan Stanley?\r\n-> I am getting to learn Finance alongside Coding, so why not use such great opportunity.\r\n\r\n3. Leadership qualities\r\n\r\n4. What your friends think about you?\r\n\r\nWhat do they expect :\r\nWhen are you planning for higher studies?\r\n-> Don\'t give an affirmative nor a negative answer for this. A diplomatic answer will prove to be a good answer for this.\r\nJust told that since i don\'t know what subject exactly i want to do MS in, i have no plans for MS currently.\r\nHe was satisfied with this answer.\r\n\r\nWhy Morgan Stanley :\r\n-> They want to see that you are truely dedicated to work with this company and they actually expect answers in that way.\r\nThe moment they catch you that you are here just because you have cleared your test and for getting some stipend, its gonna be a trouble for you.\r\nSo kindly manage to answer such questions properly.',1,11),(41,60,'20 MCQs + 2 Coding Questions:\r\nMCQs based on Data Structures like binary trees, arrays and OS concepts.\r\nCoding quesiton of low level difficulty shouldn\'t be a problem if you are regular in competitive coding.\r\nHere are the questions they asked:\r\n1. http://www.geeksforgeeks.org/find-minimum-difference-pair/\r\n2. http://www.geeksforgeeks.org/print-kth-element-spiral-form-matrix/\r\nNote: Optimized solution is desired.',1,16),(42,45,'2 easy Coding Questions were asked:\r\nThey desire you to come up to the most optimized solution starting from the least optimized one.\r\n1. Given a number in how many ways can it be reduced to 0.\r\n         Rules for reduction\r\n         1. subract by 2\r\n         2. subract by 3\r\n         3. subract by 5\r\nthis is silimar to coin exchange problem. http://www.geeksforgeeks.org/dynamic-programming-set-7-coin-change/\r\n2. Given a binary tree print its left view. http://www.geeksforgeeks.org/print-left-view-binary-tree/\r\n\r\n\r\n',1,10),(43,45,'1 Coding quesiton and 1 Alogrithm design question\r\nCoding question:\r\nThe interviewer asked me what was my favourite data structure out of linked list, trees and graph.\r\nI said linked list. This is what he asked, http://www.geeksforgeeks.org/detect-and-remove-loop-in-a-linked-list/\r\nAlgorithm design quesiton:\r\nThe question goes like this:\r\nAs you all know amazon is gigantic e-commerce platform having a number of sellers and and buyers.\r\nEach seller has his list of favourite customer(s) and vice-versa. I was required to come up with an algorithm which would make pair of buyer and customer such that both are favourite of each other.\r\nI gave him my initial approach. I said it will not always be possible to do such pairing.\r\nThen I suggested that I will maintain a NxN matrix which will have 1 if both buyer and seller likes each other or 0 otherwise.\r\nThen choose the row(column) with least number of 1,s and choose any one of the 1\'s and make all other 1\'s in that row and column to 0, repeat this for all other rown(columns). I was not sure whether my solution was correct but the interviewer seemed to be satisfied.(Luckily he didn\'t ask me to code this one :P)',2,10),(44,45,'In this round I was asked 1 coding quesiton and some questions on trees.\r\nHere is the coding quesiton http://www.geeksforgeeks.org/median-of-stream-of-integers-running-integers/\r\nAfter discussing the solution from the most in elegant solutoin using arrays to the most effecient one using heaps he asked me to code the solution.\r\nIn my code there were some redundant code he pointed me those and advied me to avoid doing such things as this will affect he code quality.\r\nAfter that the discussion was on trees:\r\nHe gave me an in-order traversal and post-order traversal of a BST and asked me to construct the BST.\r\nI tried deducing an algorithm for it but ultimately came to the conclsion that it is not possible as ther there is no way we could figure out the root ement around which we could split the given input for its left and right subtree',3,10),(45,45,'1 Coding quesiton and Questions on OS\r\nThis is how the question goes you are given a string of \'I\' and \'D\'(length upto 8)\r\n\'I\' = increasing, \'D\' = decreasing\r\nSo according to the string you have to output a series of numbers which satisfy the following conditions\r\nlet s(length n) be the input string and op[n+1] be the output array\r\nif s[i]=\'I\' then op[i]<op[i+1]\r\nif s[i]=\'D\' then op[i]>op[i+1]\r\n0<=i<n\r\nThere could be multiple answers and you need to output the array which has the minimum lexiographic value\r\nsuppose s=III then op could be [1 2 3 4], [2 3 4 5], .... [6 7 8 9]\r\nsince [1 2 3] has the minimum lexiographic value so it is the answer\r\nsuppose s=DIDII then op=[2 1 4 3 5 6]\r\nNOTE: Each digit is used only once.\r\n\r\nHe then asked me the most naive solution which has a time complexity of O((N+1)!).\r\nAfter he gave his O(N^2) solution and asked me to optimize it further and I gave him an O(N) soulution.\r\nI coded the solution, however I forgot to decrement one of the loop counters after the inner loop but he noticed that bug in my code but he didn\'t allow me to correct it.\r\n\r\nAfter this he asked questions on operating systems.\r\n1.What is a process?\r\n2.What is a therad?\r\n3.What is the difference between them? Their advantages and disadvantages over each other.\r\n4.Process and therad scheduling algorithms\r\n5.What is deadlock? Why is it happens?\r\n6.How to prevent them?\r\n\r\nAfter that we discussed about my internship\r\n\r\n\r\n',1,10),(46,60,'A written technical round was conducted.It consisted of 3 coding questions mostly based on matrices',1,17),(47,45,'Discussion on round 1 was done mostly.I was asked to solve my mistakes of round1 there.Some basic questions on arrays,strings and datastructures were asked.',1,10),(48,45,'This was a bit challenging than round 2 . Questions based on data structures and trees were asked .The main focus was on trees(AVL tree, red-black tree)\r\nArrays are also covered.\r\nMost of the questions were form geeksandgeeks',3,10),(49,15,'Tell me about yourself?\r\nWhy did you select Factset?\r\nAre you open to technologies?\r\nIs the location preferable?',1,11),(50,90,'The test was divided into 6 sections.\r\n1.General Aptitude\r\n2.Technical Comprehension\r\n3.Logical Analysis #1\r\n4.Logical Analysis #2\r\n5.Program Tracing\r\n6.Programming\r\n-> Four of them consisted of basic aptitude questions (time and work, Age, etc.) and logical interpretation. One type of question was they had given a statement and there were 4 answer choices, Statement 1 correct, Statement 2 correct, Both Correct, Both incorrect, Like that. They also provided a technical passage for comprehension and asked questions on the passage.\r\n-> The fifth section was to interpret a program and write its output value, for a given input.\r\n-> The last section was to write a function in either java or C for a given question. Given an array, find a subarray which is increasing or decreasing (Not necessarily consecutive but in the same order as original array) and print the difference of first and last term of that array (Print whichever gives max difference).\r\n',3,16),(51,60,'Technical Round 1 :\r\n1. He asked me little about myself.\r\n2. He asked me about my family background, what my parents do, etc.\r\n3. He glanced through my resume. I had participated in a hackathon held by Barclays which I had mentioned in resume so he started asking questions regarding the software we had developed in the hackathon, how it worked, what technology was used,etc. He gave a different scenario of the same problem statement and asked how would i change my software then. (This discussion was most of the round 1).\r\n4. He then asked me to write an sql query. \r\nThree tables were given\r\nTable 1: Employee ID, Employee Name\r\nTable 2: Employee ID, Company Name\r\nTable 3: Company ID, Company Name\r\nAll the 3 tables are mapped to each other. Write Query -> Given a Company ID, Output the Employee Name.\r\n5. Asked me some OOPs concepts.\r\nThis Round was mostly based on resume and lasted for about 60 mins.In this Round i Felt he was asking very general questions and was expecting very specific answers. He was not satisfied with my answers (most of them.). Interviewer Rejected me after this round and I was asked to go back.\r\n\r\nAfter an hour i got a call from TnP asking me to come back. Apparently I had topped the online test :P so they wanted to take another Technical round.\r\nTechnical Round 2:\r\nThis round lasted for about 90 mins. and there were two different panelists this time. They started by asking a little about myself, again :P\r\nMy resume was mostly about Android Development so they asked me in depth about android programming.\r\nI had done a project in IOT(Internet Of Things) during my intern. They asked me in depth about that project, what is cloud, how did you achieve connectivity between robot and mobile (project related. ). They literally asked me to write a program for bluetooth socket connection for android application ! I was able to answer all of their questions.\r\nQuestions about Neuro Fuzzy techniques, what is fuzzy logic, what are the different algorithms in NFT,etc.\r\nQuestions related to computer networks, how packets flow from one network to another, what is OSI model, specify all the layers with their functions.\r\nQuestions related to dbms, what is atomicity, what is normalization.\r\nThey then handed me a xerox copy of the code which i had written in Online test and asked me if i remember what code that is :P They asked me to explain the whole code which I did and then they asked if i can optimize the code. They gave me 10 mins. to optimize and they left the room. I was able to optimize the code and when they came back i explained it to them. \r\nThey asked me if I have any questions for them. End.',3,10),(52,30,'Started with \"Tell me about yourself\". This is a standard question so keep this prepared for any future interview in any company. He then asked me about the values of Barclays (RISES) that they had mentioned in the ppt and how do I fit myself in that values. I had memorized the values :P and told him with examples from my real life how I fit in that values. He then asked me little bit about coding and the online test (Just a little bit chatter.). Then he asked me if I have any questions for him (This is important. Always ask! ). End.',1,11),(53,60,'\r\n1. Introduce yourself and describe projects.\r\n2. Strengths and weaknesses.\r\n3.What is datastructure?Which one you like.?\r\n4.Questions on project you did like why did you prefer a particular language or ide? What were the challenges?\r\n5.Mathematical puzzles(4 to 5 puzzles)[It was expected to think aloud, in some questions hints were provided]\r\n6.Given a linked list how will you detect a cycle and how will you detect the node from which it will start? Code it.(optimal solution was required with proper syntax)[I gave few ways to this problem and then reached to optimal solution]\r\n7.Egg dropping puzzle(Algorithm was expected)\r\n8.OS related: what is multiprogramming? What are threads?what do we mean by kernel level implementation of threads?(I was expected to throw light on advantages of threads and convince that I am aware of the concept. Much details weren\'t expected) \r\n9. I was asked to write code for one puzzle where I was provided with one situation and few helper function were given.(I am not able to recollect the question )\r\n10. OOPS related questions were asked.(Mainly tricky conceptual questions on abstract classes and inheritance in JAVA and C++, Interfaces)\r\n11. What is that you are interested in which is not mentioned in resume?\r\n12.Which was your favourite subject during 12th? And asked questions related to that subject.',3,10),(54,30,'1.Why you want to join Jpmorgan?\r\n2.Why company should hire you?\r\n3.What is the difference, if company hires someone from local college of Nagpur and VNIT?\r\n4.Checks your knowledge about company!(Impress by stating some facts about their company, Awards they won and thus you are fascinated to join them)\r\nThey try and trap you but DO NOT change your statements , be firm.\r\n5.Location and shift preferences.\r\n',3,11),(55,60,'The written test was meant for shortlisting the candidates who had applied for the company. There were three questions, all of which could be comfortably solved if the clarity in dynamic programming concordant with arrays and strings is sound. Out of the three questions, one, based on arrays was very novice. It was based on making some given pattern. From more than 100 students, if I am not faltering in numbers, about 20 students were shortlisted for the interviews.',3,17),(56,40,'This was a sort of explanatory session, in which you explain the methods or the approaches you might have had thought while solving the previously mentioned written test. They asked for some improvements in the already written code. For example, in one of the questions where the time complexity was O(n^3), they stressed for about 10 minutes to write the same code with a  better time complexity.\r\nThey also focussed on trees a lot. They mentioned a BST and asked to print its envelope. Each time I answered, they modified the question and asked me to redo the same. One thing which helped me was the genial nature of the interviewers. They (there were 2 in my panel) were very soft in speech and always gave me empressement whenever I moved ahead in the task assigned; =this boosted confidence and I think I answered what they had anticipated. So don\'t feel panic when you are stuck at some point. Take your own sweet time and the interviewers always appreciate this.',1,10),(57,75,'This was a bit challenging round for me. The interviewer( who was the senior most among the people came to the campus) was very friendly and immediately made me feel at home when he started his first question on sorting. He asked about quick sort and a short comparative analysis of the time and space complexities of major sorting algorithms. Though these type of questions were expected, I answered them quite well, not losing a bit of my composure. Then, he went on to asking questions on strings,the array of pointers and some simple programs. Everything was going on quite well by this time. Then he got some phone call and he asked one of his colleagues to resume the interview. This fellow inchoated his questions from graphs and trees. I think some of the questions were of the type what we find in geeks for geeks. He asked an algorithm based on graphs. I humbly told him that I was not very conversant with graph theory and he shifted again to BST. He asked about traversal of trees which can give numbers in a particular order, viz., ascending and descending. Now the old interviewer returned and gave me a pattern to print. He gave me 15 minutes to solve and told firmly that if you solve this, you are in; otherwise we are happy to interview you. They both chuckled and went away. After 20 minutes, they returned, only to find out that I had solved that.',3,10),(58,15,'They asked me about my family and my hobbies. When I told reading, he asked what was the last book I had finished. \r\nThey asked FactSet in general. CEO, Headquarter and products. I told them, not very satisfactorily, I believe.\r\nFuture plans?\r\nPreviously, how many interviews I faced?\r\nAt last when I was leaving the cabin, pretty tensed (since I was rejected 6 times previously in the interviews in the last 5 days), they sensing my nervousness, told me- \"Don\'t worry, you will get hired.\" These were the best words I heard that complete afternoon.',1,11),(59,20,'The technical round consisted of applying your areas of expertise basically in data structure design. There were mainly implementations of classical data structure problems. You need to have basic conceptual knowledge of data structures. The questions were implementation based. They expect you to write code. The written code should be legible, organized and well indented. Speak as you write, let them glimpse your thought process of coding. It was followed by discussion on the major project in the resume. Never mention DSPD assignments in your CV. Mine consisted of Big Data analytics project I worked on during IIT-B intern. Try to do the most of the talking to lead the interview into your comfort zone. Select your words wisely',3,10),(60,30,'Be honest and yet diplomatic. Was asked about my hobby and family background. It was more of a conversation. Choose a hobby which you actually pursue. Do not yet blabber on and keep it formal at best. I was asked about the books I read, reading being the hobby I stated. ',1,11),(61,30,'The reason for the difficulty level being high is we had the best interviewer for this round. The head of hiring process was an experienced person. And this interview was more of a combination of HR and technical interview. He knew how to ask the right questions and trap you. One just needs to be honest when it comes to the final selection interview, because the person is an experienced professional who knows his game. So good luck to all those who wish to be a part of this corporate paradigm.',2,10),(62,90,'The first round was an aptitude test which consisted of Verbal ,Quant and Logical Reasoning sections.The test was similar to that of CAT but the difficulty level was on the lower side.The challenging part was that there was a time limit for every question.The time limit was 90 seconds for most of the questions and 60 seconds for some. So speed and accuracy were imperative for clearing this section.',3,16),(63,30,'First round of filtering was done on basis of aptitude test. The second round of filtering was done on basis of technical test.This test consisted of 30 questions with the time limit being 30 minutes.Luckily there was no time limit for every question. This test tested the basic technical knowledge of a person. Most of the questions were from 2nd year sylabbus.There were questions from EDC,DLD,DEVICE MODELLING(2,3 questions from MOSFETs). This section could be cleared if one is  thorough with 2nd year electronics.',1,16),(64,30,'After two rounds of filtering, finally came the interview.The technical and HR interview was held together.There were two interviewers one from HR department and the other from sales department.When I went inside ,there was only 1 person -the one from sales department(who was to conduct technical interview).He introduced himself and asked me a few general questions to start with like my native place,my hobbies etc.. He was very jovial.He asked me to relax when I went I entered the interview room.He asked me around 6-7 technical questions which were very basic .Some of them are mentioned below:-\r\n\r\n1.What is the difference between a microcontroller and a microprocessor?\r\n2.Draw all the parts of microprocessor 8085(registers,buffers...)\r\n3.Draw the circuit diagram of rectifiers I have studied(he gave a sheet  to draw).\r\n4.Draw the symbol of NPN transistor\r\n5.What is SCR?\r\nThese are the questions  I can remember .There were 2 more questions which I cannot recollect but were rather simple.\r\nThe interviewer seemed to be in a good mood that day .He kept sayinf \'good\' as a token of appreciation whenenver I gave the right answer.In the end ,the HR interviewer came back and asked me if I had any questions to ask about the company.\r\n',1,10),(65,60,'1. To make a spiral(I don\'t remember problem statement but solution was to print the \'nos in a 2d matrix\' in spiral form)\r\n2. Reverse half of Linked List(In. 1->2->5->7->8->3 output: 1->2->5->3->8->7 ).',1,16),(66,120,'1. In the series (1234567891011121314....) print nth character eg(9th character is 9, 10th character is 1, 11th charcter is 0, 12th is 1. and so on).\r\n2. Basic questions on trees, traversals etc.\r\n\r\n',3,10),(67,120,'Given arrival and dept. time of n trains. find no of platform required on the station so that all trains can stop on station. (Train scheduling algo). Condition was to solve the problem with each condition \r\n      1. sorting is allowed without extra space \r\n      2. extra  space O(n) allowed but sorting is prohibited.',2,10),(68,60,'This was an online round based on the hackerrank platform. It consisted of:\r\n18 MCQs based on data structures, algorithms, aptitude, etc. Also (unexpected because OS wasn\'t taught till 4th sem) questions on operating system concepts.\r\n2 coding questions:\r\n1. A simple question on strings\r\n2. Items are sold in units of 5, 6 and 10 (don\'t remember the exact numbers). Given an integer N, find out if N items can be bought.\r\n(eg1: N = 21 = 5 + 6 + 10 => YES. eg2: N = 20. => NO)',3,16),(69,60,'NOTE: For all the interview questions, they asked me to write full, bug-free code (in any language) on paper once I arrived at an optimal solution (or a solution that the interviewer agreed upon).\r\nInterview Round 1:\r\n1.1. Given a sorted array and a key, find the frequency of the key in the array. Expected time complexity - O(log n)\r\n1.2. Given an array containing inorder traversal of a BST, construct the BST that produces the array.\r\n1.3. Questions about my summer internship project at IIT-B.',3,10),(70,60,'NOTE: For all the interview questions (except 2.1), they asked me to write full, bug-free code (in any language) on paper once I arrived at an optimal solution (or a solution that the interviewer agreed upon).\r\nInterview Round 2:\r\n2.1. Implement a stack in which (a) Push (b) Pop and (c) getMiddleElement all happen in O(1). You may use an auxiliary stack.\r\n2.2. Given a tree (not a BST, neither the nodes have a link to their parent), and a pointer to some node in the tree, find it\'s inorder successor. I did it in O(n).\r\n2.3. General questions about CS concepts like OOPs, some questions specific to C (like register, static variables)\r\n2.4. Delete a node from a circular linked list, given the key inside the node (all edge cases handled).',3,10),(71,30,'To have this conversation with everyone.  insight of all those microphones away. ',1,10),(72,30,'hared because the speech to text recognition that these guys are provided is just fantastic. The speech to text. Beacause of thisWhen to harass testing. Always good to have this time.  why only to do this. ',1,10),(73,90,'IThe screening round consisted of 10 to 15 aptitude questions and I was able to attend all of them and I was successful and clearing this aptitude test. I was selected for the next round. It was a beautiful experience. ',2,12),(74,30,'',1,10),(75,30,'The experience was amazing. ',1,10),(76,30,'The experience was amazing. ',1,10),(77,30,'huhu',1,10),(78,30,'The. The. The dax. Amazing and. Amazing and daughter sleeping. Amazing and daughter sleeping. Amazing and daughter sleeping. Amazing and daughter sleeping with us. Amazing and daughter sleeping with us on. Amazing and hottest looking at the song. Amazing and hottest looking at the song. ',2,15),(79,30,'sqsqs',1,10),(80,30,'',1,10),(81,30